CREATE DATABASE IF NOT EXISTS omweb;

USE omweb;

DROP TABLE IF EXISTS areas;

CREATE TABLE `areas` (
  `id_area` int(11) NOT NULL AUTO_INCREMENT,
  `nombre_area` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id_area`)
) ENGINE=MyISAM AUTO_INCREMENT=17 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS cliente;

CREATE TABLE `cliente` (
  `id_cliente` int(11) NOT NULL AUTO_INCREMENT,
  `nombre_cliente` varchar(255) DEFAULT NULL,
  `edad_cliente` int(11) DEFAULT NULL,
  `fechanacimiento_cliente` date DEFAULT NULL,
  `sexo_cliente` varchar(255) DEFAULT NULL,
  `tel_cliente` varchar(255) DEFAULT NULL,
  `telrefe_cliente` varchar(255) DEFAULT NULL,
  `correo_cliente` varchar(255) DEFAULT NULL,
  `estatus_cliente` varchar(11) DEFAULT NULL,
  `diacorte_cliente` date DEFAULT NULL,
  `diains_cliente` date DEFAULT NULL,
  `tipo_cliente` varchar(255) DEFAULT 'AFILIADO',
  PRIMARY KEY (`id_cliente`)
) ENGINE=MyISAM AUTO_INCREMENT=868 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS egresos;

CREATE TABLE `egresos` (
  `id_egreso` int(11) NOT NULL AUTO_INCREMENT,
  `descripcion_egreso` varchar(200) DEFAULT NULL,
  `cantidad_egreso` int(11) DEFAULT NULL,
  `turno` int(11) DEFAULT NULL,
  `area_egreso` varchar(255) DEFAULT NULL,
  `estatus_egreso` varchar(255) DEFAULT 'ACTIVO',
  `fecha_egreso` date DEFAULT NULL,
  `hora_egreso` time DEFAULT NULL,
  PRIMARY KEY (`id_egreso`)
) ENGINE=MyISAM AUTO_INCREMENT=12 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS historial_pago;

CREATE TABLE `historial_pago` (
  `id_historial` int(11) NOT NULL AUTO_INCREMENT,
  `id_cliente` int(11) NOT NULL,
  `id_usuario` int(11) NOT NULL,
  `cantidad_pagada` float DEFAULT NULL,
  `concepto_pago` varchar(255) DEFAULT NULL,
  `fecha_historial` date DEFAULT NULL,
  `hora_historial` time DEFAULT NULL,
  `turno` int(11) DEFAULT NULL,
  `des_historial` varchar(255) DEFAULT 'ACTIVO',
  `diacorte_historial` date DEFAULT NULL,
  PRIMARY KEY (`id_historial`)
) ENGINE=MyISAM AUTO_INCREMENT=1141 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS paquetes;

CREATE TABLE `paquetes` (
  `id_paquete` int(11) NOT NULL AUTO_INCREMENT,
  `nombre_paquete` varchar(30) DEFAULT NULL,
  `costo_paquete` int(11) DEFAULT NULL,
  `numero_paquete` int(11) DEFAULT NULL,
  `periodo_paquete` varchar(11) DEFAULT NULL,
  PRIMARY KEY (`id_paquete`)
) ENGINE=MyISAM AUTO_INCREMENT=40 DEFAULT CHARSET=latin1;




DROP TABLE IF EXISTS staff;

CREATE TABLE `staff` (
  `id_staff` int(11) NOT NULL AUTO_INCREMENT,
  `nombre_staff` varchar(255) DEFAULT NULL,
  `tel_staff` int(11) DEFAULT NULL,
  `telref_staff` int(11) DEFAULT NULL,
  `correo_staff` varchar(255) DEFAULT NULL,
  `area_staff` varchar(255) DEFAULT NULL,
  `cargo_staff` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id_staff`)
) ENGINE=InnoDB AUTO_INCREMENT=18 DEFAULT CHARSET=latin1;

